import React from "react";
import { Typography, Box, Button, Avatar, Input } from "@material-ui/core";

const login = () => {
  return (
    <Box
      style={{
        marginTop: "10%",
        marginLeft: "450px",
        borderRadius: "5px",
        width: "100%",
        height: "100%",
        backgroundColor: "#63738A",
      }}
    ></Box>
  );
};
export default login;
